INSERT INTO `field_data_body` VALUES('node', 'page', 0, 14, 14, 'und', 0, '<p>Slash seems awesome on tablet/mobile devices! It allows you to showcase your site everywhere and allow everybody to get the most of your content. Responsive layouts are a MUST nowadays, as each time more people use their smartphones and tablets over browsing on a desktop computer.</p>\r\n<p>Slash has a&nbsp;4 Level <strong>Fully Responsive Layout</strong> based on <strong>HTML5 and CSS3</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>iPhone/Android mobile devices </strong></li>\r\n	<li>\r\n		<strong>iPad/Tablet PC devices in Portrait</strong> and <strong>Landscape</strong> mode layout</li>\r\n	<li>\r\n		<strong>Normal Desktop Screen</strong>&nbsp;for Netbooks.</li>\r\n	<li>\r\n		<strong>Wide Screens&nbsp;</strong>such Mac or PC layout</li>\r\n</ul>\r\n<p><img alt="" src="http://demos.doublemthemes.com/slash/slash/sites/default/files/features/retina.jpg" style="width: 870px; height: auto;" /></p>\r\n', '', 'full_html');
INSERT INTO `field_data_body` VALUES('node', 'page', 0, 16, 16, 'und', 0, '<p>We aim doubts, requests and issues using a 3 way plan which includes Video Tutorials for general needs, Documentation for detailed precedures and forums for anything that can''t be solved with Docs and Videos. Feel free to contact us once you buy Slash in case you need it, it is included in your price and we will support you.</p>\r\n<p>&nbsp;</p>\r\n<h2>\r\n	VideoTutorials + Documentation + Support</h2>\r\n<p><img alt="" src="http://demos.doublemthemes.com/slash/slash/sites/default/files/features/support.jpg" style="width: 870px; height: 320px;" /></p>\r\n<h2>\r\n	Slash Video Tutorials</h2>\r\n<p>Slash has a wide set of HD Video Tutorials that allows you to know how to proceed in certain circumstances while you interact with the theme and the back end itself.</p>\r\n<p>Following is a list of main videos of Slash:</p>\r\n<ul>\r\n	<li>\r\n		<a href="https://www.youtube.com/watch?v=5AYwTnn851k&list=PLtB1ktcnJ7IUSOleEs1Wa3fp-JasbocSG" target="_blank">Installing Slash Responsive Drupal Theme</a></li>\r\n	<li>\r\n		<a href="https://www.youtube.com/watch?v=ng01nfwVXqA&list=PLtB1ktcnJ7IUSOleEs1Wa3fp-JasbocSG" target="_blank">Adding a New Slideshow Slide (only in the Mega Slider) - Slash Responsive Drupal Theme</a></li>\r\n	<li>\r\n		<a href="https://www.youtube.com/watch?v=_WM-7HJnmTI&list=PLtB1ktcnJ7IUSOleEs1Wa3fp-JasbocSG" target="_blank">Adding a New Article - Slash Responsive Drupal Theme</a</li>\r\n	<li>\r\n		<a href="https://www.youtube.com/watch?v=m4pCLWO_WuA&list=PLtB1ktcnJ7IUSOleEs1Wa3fp-JasbocSG" target="_blank">Adding a New Portfolio Item - Slash Responsive Drupal Theme</a</li>\r\n	<li>\r\n		<a href="https://www.youtube.com/watch?v=Wxlc5cycTb4&list=PLtB1ktcnJ7IUSOleEs1Wa3fp-JasbocSG" target="_blank">Changing the Logo - Slash Responsive Drupal Theme</a></li>\r\n	<li>\r\n		<a href="https://www.youtube.com/watch?v=t4A4rOWVDuE&list=PLtB1ktcnJ7IUSOleEs1Wa3fp-JasbocSG" target="_blank">Change the Contact Form Mail - Slash Responsive Drupal Theme</a</li>\r\n	<li>\r\n		<a href="https://www.youtube.com/watch?v=ljWSoqSwQ8M&list=PLtB1ktcnJ7IUSOleEs1Wa3fp-JasbocSG" target="_blank">Creating a New Page - Slash Responsive Drupal Theme</a</li>\r\n	<li>\r\n		<a href="https://www.youtube.com/watch?v=abpKcG04Co4&list=PLtB1ktcnJ7IUSOleEs1Wa3fp-JasbocSG" target="_blank">Updating Drupal Core Version - Slash Responsive Drupal Theme</a</li>\r\n	\r\n</ul>\r\n<h2>\r\n	Slash Documentation</h2>\r\n<p>To read all Slash Documentation (it is also included on the package once you buy Slash), but can also previewed here http://demos.doublemthemes.com/slash/documentation/</p>\r\n', '', 'full_html');
INSERT INTO `field_data_body` VALUES('node', 'page', 0, 17, 17, 'und', 0, '<p>Slash includes 2 awesome Premium Slideshows: MD Slider &amp; Cute Slider. Both provide to Slash Home Pages a beauty and powerful tool to present your business and impress your visitors.</p>\r\n<p><img alt="" src="http://demos.doublemthemes.com/slash/slash/sites/default/files/features/sliders.jpg" style="width: 870px; height: auto;" /></p>\r\n<h2>\r\n	Animate each element on a Timeline</h2>\r\n<p>Both Premium Sliders provide a timeline where you can add as many visual HTML elements as you want such as Text, Images and YouTube/Vimeo videos. Major features are:</p>\r\n<ul>\r\n	<li>\r\n		+ 100 Transitions, including 3D and 2D</li>\r\n	<li>\r\n		Timeline HTML elements editor.</li>\r\n	<li>\r\n		Each element can be independently animated.</li>\r\n</ul>\r\n<p><img alt="" src="http://demos.doublemthemes.com/slash/slash/sites/default/files/features/timeline.jpg" style="width: 870px; height: auto;" /></p>\r\n', '', 'full_html');
