INSERT INTO `field_data_body` VALUES('node', 'page', 0, 37, 37, 'und', 0, '<p>Slash is a <strong>Retina Responsive HTML5 &amp; CSS3 Bootstrap</strong> based Drupal theme for Agency, Portfolio, Business and Corporate websites. It includes a lot of features you can easily setup to get your site 99% ready in just a few minutes.</p>\r\n<p>It includes 2 different Home Pages and Premium Sliders with +100 jQuery effects each, a fully responsive layout (try resizing your browser) for iPhone and Smartphones in both portrait and landscape mode, iPad and tablet, desktop and wide screens, 4 different products portfolios, a blog, a wide social media + Google Maps integration and many more you can read on a detailed list. It also includes a wide set of blocks, views, docs, modules and features packaged with an easy 5 steps installation via the "Next, next ..." format.</p>\r\n<p><img alt="" src="http://demos.doublemthemes.com/slash/slash/sites/default/files/features/overview.jpg" style="width: 870px; height: auto;" /></p>\r\n<p>This theme was built containing a lot of SEO best practices. It uses, in every View &amp; Content Page, semantically valid HTML code and CSS so search engines can index them easily. Headlines are where they should be (h1, h2, h3, h4, etc.) depending on the View hierarchy. - See more at: http://www.themesnap.com/premium-drupal-themes/slash.html</p>\r\n<h2>\r\n	Detailed List of Features</h2>\r\n<ul>\r\n	<li>\r\n		4 Level <strong>Fully Responsive Layout</strong> based on <strong>HTML5 and CSS3</strong>\r\n		<ul>\r\n			<li>\r\n				<strong>iPhone/Android mobile devices </strong></li>\r\n			<li>\r\n				<strong>iPad/Tablet PC devices in Portrait</strong> and <strong>Landscape</strong> mode layout</li>\r\n			<li>\r\n				<strong>Normal Desktop Screen</strong> as Netbooks</li>\r\n			<li>\r\n				<strong>Wide Screens&nbsp;</strong>such Mac or PC layout</li>\r\n		</ul>\r\n	</li>\r\n	<li>\r\n		Super <strong>Easy Installation</strong>: "Next, next, next..." format. Based on an installation profile. Watch the tutorial video.</li>\r\n	<li>\r\n		<strong>Retina Devices</strong> supported with enhaced graphics and content images automatically</li>\r\n	<li>\r\n		Built with <strong>Bootstrap</strong> 2.3.x</li>\r\n	<li>\r\n		<strong>2 Home Pages</strong> you can select to set your Home and different block combinations</li>\r\n	<li>\r\n		<strong>2 Premium jQuery Sliders</strong> with + 100 effects each\r\n		<ul>\r\n			<li>\r\n				MD Slider (<strong>Value of $20</strong>) on the main Home Variant.</li>\r\n			<li>\r\n				Cute Slider (<strong>Value of $18</strong>) on the second Home Variant</li>\r\n		</ul>\r\n	</li>\r\n	<li>\r\n		<strong>4 Products Portfolios</strong>: 4 Columns, 3 Columns, 2 Column and 1 Column</li>\r\n	<li>\r\n		<strong>Left Sidebar, Right Sidebar and No Sidebar</strong> options for custom pages</li>\r\n	<li>\r\n		<strong>Contact page</strong> with a form and <strong>Google Maps API 3</strong> integration (you can setup your business location just using a marker)</li>\r\n	<li>\r\n		<strong>Unlimited Color Variants</strong> using a Color Picker.</li>\r\n	<li>\r\n		<strong>+500 WebFonts</strong> via Google Fonts, Fontsquirrel...</li>\r\n	<li>\r\n		<strong>100% Internationalizable Interface</strong>. Read Internationalization Instructions.</li>\r\n	<li>\r\n		Awesome <strong>Contextual Content Edition</strong> on every included View</li>\r\n	<li>\r\n		Advanced <strong>typography features</strong> with enhaced readability</li>\r\n	<li>\r\n		<strong>WYSIWYG text editor</strong> for creating rich text formats</li>\r\n	<li>\r\n		Advanced <strong>Image/Files uploading interface</strong> for rich content creation</li>\r\n	<li>\r\n		Article <strong>Sharing via +300 social media resources</strong> via Addthis including: Facebook, Twitter, Mail, LinkedIn, StumbleUpon, etc.</li>\r\n	<li>\r\n		<strong>Usability and UX enhancements</strong>: Navigation Breadcrumbs, Friendly URLs, Responsive Layout, Contextual Content Edition, DropDown Navigation, Social Media integration and detailed Documentation.</li>\r\n	<li>\r\n		Custom Blocks/Views Included:\r\n		<ul>\r\n			<li>\r\n				<strong>Site Features</strong> (2 bocks: horizontal and lateral variant)</li>\r\n			<li>\r\n				<strong>Our Clients</strong> (2 blocks: Desaturated Logos + Color transition on hover. Great for placing your client logos)</li>\r\n			<li>\r\n				<strong>Recent Tweets</strong> (from your Twitter Account)</li>\r\n			<li>\r\n				<strong>Recent News</strong></li>\r\n			<li>\r\n				<strong>Recent Products</strong></li>\r\n			<li>\r\n				<strong>Follow Us</strong> (Via the most popular social resources)</li>\r\n		</ul>\r\n	</li>\r\n	<li>\r\n		<strong>+10 Prebuilt Views</strong></li>\r\n	<li>\r\n		<strong>Valid HTML5 &amp; CSS3 code</strong></li>\r\n	<li>\r\n		<strong>SEO Optimized</strong> HTML code, layout, blocks &amp; Views for higher ranking probabilities</li>\r\n	<li>\r\n		<strong>Sample content</strong> for you to have the site build from scratch after installation.</li>\r\n	<li>\r\n		<strong>Works in all major browsers</strong>: Internet Explorer 8, Mozilla Firefox 3.6, Google Chrome 12, Opera 10 &amp; Safari 4 and their respective later versions.</li>\r\n	<li>\r\n		<strong>Detailed and friendly Documentation</strong> on "How to..." with graphics you can preview here.</li>\r\n	<li>\r\n		<strong>Rock solid customer support</strong> in our support forums for theme buyers.</li>\r\n</ul>\r\n', '', 'full_html');
INSERT INTO `field_data_body` VALUES('node', 'page', 0, 38, 38, 'und', 0, '<p>With Slash we won''t leave behind our practice of including sample content with the theme. It allows you to have the site working EXACTLY* as the demo in less than 5 minutes, just after finishing the installation process.</p>\r\n<h2>\r\n	Boosts Site Setup</h2>\r\n<p>Have you ever been trough the frustration of installing a theme and have no idea of how to make it just like the demo you liked before? Well, Slash is the demo.</p>\r\n<p><img alt="" src="http://demos.doublemthemes.com/slash/slash/sites/default/files/features/sample.jpg" style="width: 870px; height: auto;" /></p>\r\n<p>It is always better to start from a base setup of content than needing to gather all the sample info that will help you to show your customer how his website will be seen or even how your own site is working right now. Theme includes sample articles, Portfolio Items, Services, Slideshows, Client''s logos, Customer Feedback, Menu, etc.</p>\r\n<h2>\r\n	Contextual Content Edition</h2>\r\n<p>Additionaly, Contextual Content edition allows you to directly edit content right where it is shows, no matter where: a View, a block, the footer, the sidebar. Once you''re logged in, you will find the red tags all across the theme over your content.</p>\r\n<p><img alt="" src="http://demos.doublemthemes.com/slash/slash/sites/default/files/features/contextual.jpg" style="width: 870px; height: auto;" /></p>\r\n<p><span style="color:#a9a9a9;">* Demo Images are not included on the downloadable package for copyright reasons. Instead of them you will get gray images replacing the exact place and function of each demo image. All demo images are properly licensed to DoubleMThemes for demo purposes only. Car Images are property of <a href="http://www.flickr.com/photos/davidvillarreal/">David Villarreal</a> and Licensed under <a href="http://creativecommons.org/licenses/by-nc/2.0/">Creative Commons</a>.</span></p>\r\n', '', 'full_html');
INSERT INTO `field_data_body` VALUES('node', 'page', 0, 39, 39, 'und', 0, '<p><img alt="" src="http://demos.doublemthemes.com/slash/slash/sites/default/files/features/colors.jpg" style="width: 870px; height: auto;" /></p>\r\n<p>Slash allows you to set different color variations starting from a backend GUI Tools that allows you to choose the main colors of the theme just using a Color Picker and generating the CSS files automatically.</p>\r\n<p>Advanced Web Developers can even add more customizations and backend color sets to End Clients, allowing them to customize the theme even more, deppending on your project scope.</p>\r\n<p><img alt="" src="http://demos.doublemthemes.com/slash/slash/sites/default/files/features/palette.jpg" style="width: 870px; height: auto;" /></p>\r\n', '', 'full_html');
