INSERT INTO `search_dataset` VALUES(37, 'node', ' theme overview slash is a retina responsive html5 css3 bootstrap based drupal theme for agency portfolio business and corporate websites it includes a lot of features you can easily setup to get your site 99 ready in just a few minutes it includes 2 different home pages and premium sliders with 100 jquery effects each a fully responsive layout try resizing your browser for iphone and smartphones in both portrait and landscape mode ipad and tablet desktop and wide screens 4 different products portfolios a blog a wide social media google maps integration and many more you can read on a detailed list it also includes a wide set of blocks views docs modules and features packaged with an easy 5 steps installation via the next next format this theme was built containing a lot of seo best practices it uses in every view content page semantically valid html code and css so search engines can index them easily headlines are where they should be h1 h2 h3 h4 etc depending on the view hierarchy see more at  http wwwthemesnapcom premiumdrupalthemes slashhtml detailed list of features 4 level fully responsive layout based on html5 and css3 iphone android mobile devices ipad tablet pc devices in portrait and landscape mode layout normal desktop screen as netbooks wide screens  such mac or pc layout super easy installation  next next next format based on an installation profile watch the tutorial video retina devices supported with enhaced graphics and content images automatically built with bootstrap 23x 2 home pages you can select to set your home and different block combinations 2 premium jquery sliders with 100 effects each md slider  value of 20  on the main home variant cute slider  value of 18  on the second home variant 4 products portfolios  4 columns 3 columns 2 column and 1 column left sidebar right sidebar and no sidebar options for custom pages contact page with a form and google maps api 3 integration you can setup your business location just using a marker  unlimited color variants using a color picker  500 webfonts via google fonts fontsquirrel  100 internationalizable interface  read internationalization instructions awesome contextual content edition on every included view advanced typography features with enhaced readability wysiwyg text editor for creating rich text formats advanced image files uploading interface for rich content creation article sharing via 300 social media resources via addthis including facebook twitter mail linkedin stumbleupon etc usability and ux enhancements  navigation breadcrumbs friendly urls responsive layout contextual content edition dropdown navigation social media integration and detailed documentation custom blocks views included  site features  2 bocks horizontal and lateral variant  our clients  2 blocks desaturated logos color transition on hover great for placing your client logos  recent tweets  from your twitter account  recent news recent products follow us  via the most popular social resources   10 prebuilt views valid html5 css3 code seo optimized html code layout blocks views for higher ranking probabilities sample content for you to have the site build from scratch after installation works in all major browsers  internet explorer 8 mozilla firefox 36 google chrome 12 opera 10 safari 4 and their respective later versions detailed and friendly documentation on how to with graphics you can preview here rock solid customer support in our support forums for theme buyers  ', 1372395046);
INSERT INTO `search_dataset` VALUES(38, 'node', ' sample content included with slash we won t leave behind our practice of including sample content with the theme it allows you to have the site working exactly as the demo in less than 5 minutes just after finishing the installation process boosts site setup have you ever been trough the frustration of installing a theme and have no idea of how to make it just like the demo you liked before well slash is the demo it is always better to start from a base setup of content than needing to gather all the sample info that will help you to show your customer how his website will be seen or even how your own site is working right now theme includes sample articles portfolio items services slideshows client s logos customer feedback menu etc contextual content edition additionaly contextual content edition allows you to directly edit content right where it is shows no matter where a view a block the footer the sidebar once you re logged in you will find the red tags all across the theme over your content demo images are not included on the downloadable package for copyright reasons instead of them you will get gray images replacing the exact place and function of each demo image all demo images are properly licensed to doublemthemes for demo purposes only car images are property of david villarreal and licensed under creative commons   ', 1372395072);
INSERT INTO `search_dataset` VALUES(39, 'node', ' unlimited color variations slash allows you to set different color variations starting from a backend gui tools that allows you to choose the main colors of the theme just using a color picker and generating the css files automatically advanced web developers can even add more customizations and backend color sets to end clients allowing them to customize the theme even more deppending on your project scope  ', 1372395055);
